/*!

=========================================================
* Light Bootstrap Dashboard React - v1.3.0
=========================================================

* Product Page: https://www.creative-tim.com/product/light-bootstrap-dashboard-react
* Copyright 2019 Creative Tim (https://www.creative-tim.com)
* Licensed under MIT (https://github.com/creativetimofficial/light-bootstrap-dashboard-react/blob/master/LICENSE.md)

* Coded by Creative Tim

=========================================================

* The above copyright notice and this permission notice shall be included in all copies or substantial portions of the Software.

*/
import React, { Component } from "react";
import { Grid, Row, Col, Alert } from "react-bootstrap";
import CustomCheckbox from "components/CustomCheckbox/CustomCheckbox";
import { ReactTypeformEmbed } from 'react-typeform-embed';


class ToDos extends Component {
  render() {
    return (
      <div className="content">
        <Grid fluid>
          <div className="card">
            <div className="header">
              <h4 className="title">Tasks</h4>
            </div>
            <div className="content">
              <Row>
                <Col md={12}>
                  <CustomCheckbox number={1} label="Complete Profile Setup" />
                  <CustomCheckbox number={2} label="Monthly Sentiment Survey" />
                  <CustomCheckbox number={3} label="Implicit Bias Test 1" />
                  <CustomCheckbox number={4} label="Implicit Bias Test 2" />
                  <ReactTypeformEmbed url="https://udishab.typeform.com/to/kyXsKDLO" buttonText="press this" />
                </Col>
              </Row>
            </div>
          </div>
        </Grid>
      </div>
    );
  }
}

export default ToDos;
